import React, { useEffect } from 'react';
import Table from 'react-bootstrap/Table';


export function ClienstRegistered() {
  const[client, setClient] = useEffect([]);

  useEffect(() => {
    fetch('http://localhost:5000/users')
    .then(res => res.json())
    .then(data => console.log('Sergio: ',data))
  }, []);

  return(
    <p> test </p>
  )
}
export default ClienstRegistered;
